    /**
   * Hide Header on on scroll down on mobile
   */
  var didScroll;
  var lastScrollTop = 0;
  var delta = 5;
  var navbarHeight = $('.header-container-wrapper').outerHeight();

  $(window).scroll(function(event){
    didScroll = true;
  });

  setInterval(function() {
    if (didScroll) {
      hasScrolled();
      didScroll = false;
    }
  }, 250);

  function hasScrolled() {
    var st = $(this).scrollTop();

    // Make sure they scroll more than delta
    if(Math.abs(lastScrollTop - st) <= delta)
      return;

    // If they scrolled down and are past the navbar, add class .nav-up.
    // This is necessary so you never see what is "behind" the navbar.
    if (st > lastScrollTop && st > navbarHeight){
      // Scroll Down
      $('.header-container-wrapper').removeClass('nav-down').removeClass('nav-neutral').addClass('nav-up');
    } else {
      // Scroll Up
      if(st + $(window).height() < $(document).height()) {
        if(st <= navbarHeight) {
          $('.header-container-wrapper').removeClass('nav-up').removeClass('nav-down').addClass('nav-neutral');
        } else {
          $('.header-container-wrapper').removeClass('nav-up').removeClass('nav-neutral').addClass('nav-down');
        }
      }
    }

    lastScrollTop = st;
  }


